export function loginApp(state = [], action) {
  switch (action.type) {
    case "LOGIN_AUTH":
      return [
        ...state,
        {
          userName: action.loginDetails.email,
          password: action.loginDetails.password
        }
      ]
    default:
      return state
  }
}
